import React from "react";
import { PresentationPageStyle } from "../../styles/PresentationPage.style.ts";

function PresentationPage() {
  return (
    <PresentationPageStyle>
      <h1>About me</h1>
     <p>I am Ryad Laouedj, 28 years old and student at 42 Paris.</p>
     <p>After studying law and art I decided to dive into the programming world.</p>
     <p>I see programming as a way of solving everyday problems but also as a tool of Creativity</p>
     <p>My course at 42 Paris made me approach several subjects as A</p> 
    </PresentationPageStyle>
  );
}

export default PresentationPage;
